description:
Category	All Girl, Girl-Girl, Lesbian

Director	Pat Myne
Starring	Romi Rain, Aidra Fox, Sarah Vandella, Lola Foxx, Nina Elle, Mercedes Carrera, Tara Morgan, Xandra Six

Teach Me is a celebration of the beautiful exchanges between older and younger women. Watch these more experienced stars share themselves, and their sexual depth, nurturing a selection of young starlets who are fresh to the business. Teach Me is a very unique depiction of this older/younger fantasy and captures incredibly passionate and powerful lesbian scenes that you will not forget. Enjoy!
